def encrypt(s):
    alphabet = 'abcdefghijklmnopqrstuvwxyz'
    encrypted = ''
    for char in s:
        if char in alphabet:
            index = (alphabet.index(char) + 2 * 2) % 26
            encrypted += alphabet[index]
        else:
            encrypted += char
    return encrypted

def encode(message):
    vowels = 'aeiouAEIOU'
    encoded = ''
    for char in message:
        if char in vowels:
            index = vowels.index(char)
            encoded += chr((index + 2) % 5 + 97)
        else:
            encoded += char.swapcase()
    return encoded

