    return "YES"

def minPath(grid, k):
    def dfs(x, y, path, depth):
        if depth == k:
            return path
        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]):
                dfs(nx, ny, path + [grid[nx][ny]], depth + 1)
    return dfs(0, 0, [grid[0][0]], 1)

def tri(n):
    if n == 0:
        return [3]
    elif n == 1:
        return [3, 1]
    elif n == 2:
        return [3, 1, 2]
    else:
        sequence = [3, 1, 2]
        for i in range(3, n + 1):
            if i % 2 == 0:
                sequence.append(sequence[i - 1] + 1)
            else:
                sequence.append(sequence[i - 1] + sequence[i - 2] + sequence[i + 1])
        return sequence

